"When lockdown happened, I was with him all the time. Wherever I went in the house he would follow me."

@rachyoungeritv speaks to one woman who was trapped with her abusive partner when the first Covid restrictions were introduced in March. 

https://t.co/hrnFQbVCBi

 "It's a big improvement on what we had in place for the last lockdown in March."

@SMFC_FEP are having to go virtual to deal with the challenges presented by the national lockdown. 

 #SMFC #YourSolihullYourClub

You should only leave your home for essential purposes during this period, such as:

 To get food or medicine;
 To get medical assistance;
 To exercise.

Remember #StayAtHome to #ProtectTheNHS and Save Lives.

